import React from 'react';
import './MainPage.css';
import * as bootstrap from 'bootstrap';
import Logo from '../Assets/logo.png';
export default function MainPage() {
    const dropdownElementList = document.querySelectorAll('.dropdown-toggle')
    const dropdownList = [...dropdownElementList].map(dropdownToggleEl => new bootstrap.Dropdown(dropdownToggleEl))

    return(
        <div className="header">
            <div className="logo-container">
                <img className="logo-img" src={Logo} alt="logo image"/>
            </div>
            <div className="nav-container">
                <ul className="nav nav-pills">
                    <li className="nav-item">
                        <a className="nav-link" aria-current="page" href="#">Active</a>
                    </li>
                    <li className="nav-item dropdown">
                        <a className="nav-link dropdown-toggle" data-bs-toggle="dropdown" data-bs-target="navBar" href="#" role="button" aria-expanded="false">Dropdown</a>
                        <ul className="dropdown-menu" id="navBar">
                            <li><a className="dropdown-item" href="#">Action</a></li>
                            <li><a className="dropdown-item" href="#">Another action</a></li>
                            <li><a className="dropdown-item" href="#">Something else here</a></li>
                            <li><hr className="dropdown-divider"/></li>
                            <li><a className="dropdown-item" href="#">Separated link</a></li>
                        </ul>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link" href="#">Link</a>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link disabled" aria-disabled="true">Disabled</a>
                    </li>
                </ul>
            </div>

        </div>
    )
}

